import React from 'react';

import '../styles.css';

function History(){    

    return (
        <div id="app">
            <div id="content">
                <p className="headline2">Our History</p>                            
                    <p><div className="headline2" align="center"> Luxury restaurant was created as a Proof of Concept for Lisk sidechain blockchain.</div>
                    </p>
                    <p><div className="headline2" align="center">The goal is to demonstrate how easy can be to create a restaurant based backend that consumes the restaurant sidechain.</div></p>
                    <p>
                    <div className="headline2" align="center">
                    This site represents a sea food luxury restaurant. It's possible to list all the food offeredby restaurant in the home page.
                    </div>
                    <div className="headline2" align="center">
                        Also, it is possible to click on a food preference and command a food option desired. Once command a FoodTransaction will be created
                        in the restaurant sidechain. The transaction value will be placed on the restaurant Lisk address and the value will be debited from
                        the sender (food requester).
                    </div>
                    </p>            
                    <div className="clear"></div>               
            </div>
        </div>
    );
}

export default History;
